import React from "react";

import { Link } from "react-router-dom";
const Start3 = () => (
  <div>
    <p>
      Dukungan fitur penjualan dengan gambar dan full support touchscreen metode
      menyempurnakan untuk kasir bekerja dengan cepat via apps ini dan tentu
      saja kemudahan akses tanpa batas dalam digunakan dengan staff dan karyawan
      solusi ekonomis untuk bisnis dan usaha mu.
    </p>
    <div className="text-center">
      <Link to="/kasir" className="btn btn-danger">
        Cek Fitur Aplikasi
      </Link>
    </div>
  </div>
);

export default Start3;
